      SELECT DISTINCT + 15 FROM tab1 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0, tab1 (FORMAT parquet) AS cor1, tab1 (FORMAT parquet) AS cor2;
  - name: tab1
  - name: tab2

outputs:
  - name: q9519.out
    data: |
      15
